import './App.css';
import { Route } from 'react-router-dom';
import HomePage from './pages/homepage/homepage.component';

const Cloth = () => {
  <h1>This is Cloth component</h1>
}

function App() {
  return (
    <div>
      <Route exact path='/' component={HomePage} />
      {/* <Route path='/cloth' component={Cloth} /> */}
    </div>
  );
}

export default App;
